/*
求字符串字串，都可以用滑动窗口来解决。解决办法就是双指针
begin, end都从0开始。

end一直往后走，直到找到子串里面所有的值，这时候begin - end之间
可能会有其它的字符，这时候就begin往前走，直到begin走到不包含子串
位置，说明这个位置就是最短的子字符串。


具体的可以看下面这个对于子字符串的分析，很容易理解。

https://leetcode-cn.com/problems/find-all-anagrams-in-a-string/solution/hua-dong-chuang-kou-tong-yong-si-xiang-jie-jue-zi-/

*/

package main

import (
	"fmt"
)

func findAnagrams(s string, p string) []int {
	m := make(map[byte]int)
	result := make([]int,0)
	appearCount := 0
	left := 0
	right := 0
	for _, value := range p{
		m[byte(value)]++
	}
	for right < len(s){
		if (m[byte(s[right])] - 1) >= 0{
			m[byte(s[right])]--
			appearCount++
		}
		if appearCount == len(p){
			if right - left == (len(p) - 1){
				result = append(result, left)
				m[byte(s[left])]++
				left++
				appearCount--
			}else{
				left = right - len(p) + 1
				tmp := left
				for tmp < right{
					if _, ok := m[byte(s[tmp])];!ok{
						left = tmp + 1
						break
					}
					tmp++
				}
				right = left
				appearCount = 0
				for _, value := range p{
					m[byte(value)]++
				}
				continue
			}
		}
		right++
	}
	return result
}

func main(){
	s := ""

	p := ""
	//s := "cbaebabacd"
	//p := "abc"
	//fmt.Println(m[0])
	fmt.Println(findAnagrams(s, p))
}
